typedef ap_fixed<16,6> ap_t;
static void read_input(ap_t* in, hls::stream<input_t>& inStream, int size){
mem_rd:
    input_t array1;
    printf("Input:");
    for (int i = 0; i < size; i++) {
    #pragma HLS LOOP_TRIPCOUNT min = c_size1 max = c_size1
        array1[0] = in[i];
        inStream.write(array1);
        
}
}

// Read result from outStream and write the result to Global Memory
static void write_result(ap_t* out, hls::stream<result_t>& outStream, int size) {
// Auto-pipeline is going to apply pipeline to this loop
mem_wr:
    result_t array1; 
    array1 = outStream.read();
    
    printf("Output:");
    for (int i = 0; i < size; i++) {
    #pragma HLS LOOP_TRIPCOUNT min = c_size2 max = c_size2
        // Blocking read command to inStream
        out[i] = array1[i];
        
    }
}

